fragment:
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:infundibulocystic_basal_cell_carcinoma rdfs:subClassOf :basal_cell_carcinoma ;
    :has_definition "A variant of basal cell carcinoma characterized by follicular differentiation." ;
    :has_exact_synonym "skin infundibulocystic basal cell carcinoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nodular_basal_cell_carcinoma rdfs:subClassOf :basal_cell_carcinoma ;
    :has_definition "A basal cell carcinoma characterized by elevated, pearl shaped nodules with telengactisae on the surface and periphery." ;
    :has_exact_synonym "Basal cell carcinoma, nodular"@en,
        "Circumscribed solid basal cell carcinoma"@en,
        "skin nodulo-ulcerative basal cell carcinoma"@en,
        "skin solid (nodular) Basal cell carcinoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:metatypical_basal_cell_carcinoma rdfs:subClassOf :basal_cell_carcinoma ;
    :has_definition "A basal cell carcinoma characterized by intermediate typology between basal cell carcinoma and squamous cell carcinoma." ;
    :has_exact_synonym "Basosquamous carcinoma of skin"@en,
        "skin Metatypical carcinoma"@en,
        "skin metatypical basal cell carcinoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pigmented_basal_cell_carcinoma rdfs:subClassOf :basal_cell_carcinoma ;
    :has_definition "A basal cell carcinoma characterized by brown or black pigmentation." ;
    :has_exact_synonym "skin pigmented basal cell carcinoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anal_margin_basal_cell_carcinoma rdfs:subClassOf :basal_cell_carcinoma ;
    :has_definition "A basal cell carcinoma that is located_in the anal margin." ;
    :has_exact_synonym "Basal cell carcinoma of Perianal skin"@en ;
    :has_related_synonym "basal cell carcinoma of anal margin"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anal_margin_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :perianal_skin ],
        :anal_carcinoma,
        :skin_cancer ;
    :has_definition "An anal carcinoma that has_material_basis_in abnormally proliferating cells derives_from epithelial cells and is located_in the anal margin (where the canal meets the outside skin at the anus)." ;
    :has_exact_synonym "Perianal skin carcinoma"@en ;
    :has_related_synonym "carcinoma of anal margin"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:skin_nasal_cell_carcinoma_with_sebaceous_differentiation rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :sebaceous_gland ],
        :basal_cell_carcinoma,
        :sebaceous_carcinoma ;
    :has_definition "A basal cell carcinoma that is characterized by sebaceous differentiation and located in the skin." ;
    :has_exact_synonym "sebaceous basal cell carcinoma",
        "skin basosebaceous basal cell carcinoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:external_ear_basal_cell_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :basal_cell ],
        :basal_cell_carcinoma,
        :external_ear_carcinoma ;
    :has_exact_synonym "Basal cell carcinoma of the External ear"@en ;
    :has_related_synonym "basal cell carcinoma of external ear"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:external_ear_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :external_ear ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :epithelial_cell ],
        :carcinoma,
        :external_ear_cancer ;
    :has_definition "An external ear cancer that has_material_basis_in abnormally proliferating cells derives_from epithelial cells." ;
    :has_exact_synonym "carcinoma of the External ear"@en ;
    :has_related_synonym "carcinoma of external ear"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:micronodular_basal_cell_carcinoma rdfs:subClassOf :basal_cell_carcinoma ;
    :has_definition "A basal cell carcinoma characterized by solid tumor nodules." ;
    :has_exact_synonym "skin micronodular basal cell carcinoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gynatresia rdfs:subClassOf :female_reproductive_system_disease ;
    :has_definition "A female reproductive system disease that is characterized by the occlusion of some part of the female genital tract, especially occlusion of the vagina." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adamantinoid_basal_cell_epithelioma rdfs:subClassOf :basal_cell_carcinoma ;
    :has_exact_synonym "Basal cell carcinoma - adamantinoid"@en,
        "Melanotic adamantinoma of skin"@en,
        "skin adamantinoid basal cell epithelioma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fibroepithelial_basal_cell_carcinoma rdfs:subClassOf :basal_cell_carcinoma ;
    :has_exact_synonym "Fibroepithelioma of Pinkus"@en,
        "Fibroepithelioma of Pinkus type"@en,
        "Pinkus tumor"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:morpheaform_basal_cell_carcinoma rdfs:subClassOf :basal_cell_carcinoma ;
    :has_exact_synonym "Basal cell carcinoma, morphea"@en,
        "Cicatricial basal-cell carcinoma"@en,
        "Morphea-type (Sclerosing) Basal cell carcinoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:clear_cell_basal_cell_carcinoma rdfs:subClassOf :basal_cell_carcinoma ;
    :has_exact_synonym "skin clear cell basal cell carcinoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adenoid_basal_cell_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :pharyngeal_tonsil ],
        :basal_cell_carcinoma,
        :tonsil_cancer ;
    :has_definition "A basal cell carcinoma that is characterized by the presence of thin strands of basaloid cells forming a reticulate pattern." ;
    :has_exact_synonym "skin adenoid basal cell carcinoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:follicular_basal_cell_carcinoma rdfs:subClassOf :basal_cell_carcinoma ;
    :has_definition "A basal cell carcinoma that is characterized by follicular differentiation." ;
    :has_exact_synonym "Skin Follicular Basal Cell Carcinoma",
        "follicular (pilar) basal cell carcinoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:scimitar_syndrome rdfs:subClassOf :congenital_heart_disease ;
    :has_definition "A congenital heart disease that is characterized by partial or entire anomalous curved venous drainage of the right lung to the inferior vena cava, association with variable right lung and pulmonary artery hypoplasia, dextraposition of the heart and an anomalous systemic blood supply to the ipsilateral lung." ;
    :has_exact_synonym "Halasz syndrome",
        "congenital venolobar syndrome",
        "hypogenetic lung syndrome",
        "mirror-image lung syndrome",
        "vena cava bronchovascular syndrome",
        "pulmonary venolobar syndrome"@en,
        "total anomalous pulmonary venous return"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:infiltrative_basal_cell_carcinoma rdfs:subClassOf :basal_cell_carcinoma ;
    :has_definition "A basal cell carcinoma that is characterized by the formation of thin, small clusters in an infiltrative growth pattern." ;
    :has_exact_synonym "skin infiltrating basal cell carcinoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:superficial_basal_cell_carcinoma rdfs:subClassOf :basal_cell_carcinoma ;
    :has_exact_synonym "Multifocal superficial basal cell carcinoma"@en,
        "Superficial multicentric basal-cell carcinoma"@en,
        "multicentric basal cell carcinoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vulva_basal_cell_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :mammalian_vulva ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :basal_cell ],
        :basal_cell_carcinoma,
        :vulva_carcinoma ;
    :has_definition "A vulva carcinoma that has_material_basis_in basal cells." ;
    :has_exact_synonym "Basal cell carcinoma of Vulva"@en ;
    :has_related_synonym "basal cell carcinoma of the vulva"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cystic_basal_cell_carcinoma rdfs:subClassOf :nodular_basal_cell_carcinoma ;
    :has_definition "A nodular basal cell carcinoma that is characterized by a homogenous blue/black area." ;
    :has_exact_synonym "skin cystic basal cell carcinoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sarcomatoid_basal_cell_carcinoma rdfs:subClassOf :basal_cell_carcinoma ;
    :has_exact_synonym "skin sarcomatoid basal cell carcinoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:signet_ring_basal_cell_carcinoma rdfs:subClassOf :basal_cell_carcinoma ;
    :has_exact_synonym "skin signet ring cell basal cell carcinoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bone_giant_cell_tumor rdfs:subClassOf :benign_giant_cell_tumor ;
    :has_definition "A benign giant cell tumor that results_in the presence of multinucleated giant cells." ;
    :has_exact_synonym "Giant cell neoplasm of bone"@en,
        "Giant cell tumor of bone"@en,
        "Giant cell tumour of bone"@en,
        "bone giant cell tumour"@en ;
    :has_related_synonym "giant cell myeloma"@en,
        "osteoclastoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:radiculopathy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :paresthesia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :weakness ],
        :peripheral_nervous_system_disease ;
    :has_definition "A peripheral nervous system disease that is characterized by the pinching of a nerve root in the spine and has symptoms of pain, weakness, numbness and tingling." ;
    :has_exact_synonym "pinched nerve" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polyradiculopathy rdfs:subClassOf :radiculopathy ;
    :has_definition "A radiculopathy that is present in more than one nerve." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polyradiculoneuropathy rdfs:subClassOf :peripheral_nervous_system_disease ;
    :has_definition "A peripheral nervous system disease that is characterized by the co-occurance of polyneuropahty and polyradicuopathy and is located in both the spinal nerve roots and the peripheral nerves." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:epidermolysis_bullosa_acquisita rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :has_phenotype ;
                            owl:someValuesFrom :abnormal_immunoglobulin_level ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :zone_of_skin ;
                                                    rdf:rest [ rdf:first :connective_tissue ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ],
        :autoimmune_disease_of_skin_and_connective_tissue,
        :epidermolysis_bullosa ;
    :has_definition "An acquired epidermolysis bullosa that is characterized by formation of recurrent blisters secondary to minor trauma in the skin and mucosa, and has_material_basis_in the development of autoantibodies to type VII collagen." ;
    :has_exact_synonym "acquired epidermolysis bullosa"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:non_gestational_choriocarcinoma rdfs:subClassOf :choriocarcinoma ;
    :has_definition "A choriocarcicoma that develops in the absence of a preceding gestational event." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ebola_hemorrhagic_fever rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bloodshot_eye ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pharynx_inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :zaire_ebolavirus ;
                            rdf:rest [ rdf:first :sudan_ebolavirus ;
                                    rdf:rest [ rdf:first :bundibugyo_ebolavirus ;
                                            rdf:rest :nil ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :weakness ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bleeding ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :rash ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :contact_transmission ;
                            rdf:rest [ rdf:first :vehicle_borne_fomite_transmission ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :joint_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that is a hemorrhagic fever, has_material_basis_in Zaire ebolavirus, has_material_basis_in Sudan ebolavirus, has_material_basis_in Cote d'Ivoire ebolavirus, or has_material_basis_in Bundibugyo ebolavirus, which are transmitted_by contact with the body fluids of an infected animal or person, transmitted by contaminated fomites, or transmitted by infected medical equipment. The infection has_symptom fever, has_symptom headache, has_symptom joint pain, has_symptom muscle aches, has_symptom sore throat, has_symptom weakness, has_symptom diarrhea, has_symptom vomiting, has_symptom stomach pain, has_symptom rash, has_symptom red eyes, has_symptom hiccups, and has_symptom internal and external bleeding." ;
    :has_exact_synonym "Ebola virus disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:marburg_hemorrhagic_fever rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :maculopapular_rash ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chest_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bleeding ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pharynx_inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :orthomarburgvirus_marburgense ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that is a hemorrhagic fever, has_material_basis_in Orthomarburgvirus marburgense, which is transmitted_by contact with the body fluids of an infected person. The infection has_symptom fever, has_symptom chills, has_symptom headache, has_symptom myalgia, has_symptom maculopapular rash on the trunk, has_symptom nausea, has_symptom vomiting, has_symptom chest pain, has_symptom sore throat, has_symptom abdominal pain, has_symptom diarrhea, and has_symptom bleeding." ;
    :has_exact_synonym "Marburg disease"@en,
        "Marburg virus disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:erdheim_chester_disease rdfs:subClassOf :non_langerhans_cell_histiocytosis ;
    :has_definition "A non-Langerhans-cell histiocytosis that is characterized by the proliferation in the tissues of lipid-laden macrophages and the presence of multinucleated giant cells. It results in sclerosis of the long bones and failure of the affected organs." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:non_langerhans_cell_histiocytosis rdfs:subClassOf :histiocytosis ;
    :has_definition "A histiocytosis that is characterized by the accumulation of histiocytes that do not meet the phenotypic criteria for the diagnosis of Langerhans cells." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:burning_mouth_syndrome rdfs:subClassOf :mouth_disease ;
    :has_definition "A mouth disease that is characterized by long-lasting burning sensations of the mouth." ;
    :has_exact_synonym "Orodynia"@en,
        "Stomatopyrosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:parovarian_cyst rdfs:subClassOf :female_reproductive_system_disease ;
    :has_definition "A female reproductive system disease that is characterized by epithelium-lined fluid-filled cysts in the adnexa adjacent to the fallopian tube and ovary." ;
    :has_exact_synonym "Cyst, fimbrial"@en,
        "Embryonic fimbrial cyst"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tinea_favosa rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :scarring ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :zone_of_skin ;
                            rdf:rest [ rdf:first :scalp ;
                                    rdf:rest [ rdf:first :strand_of_hair ;
                                            rdf:rest [ rdf:first :nail ;
                                                    rdf:rest :nil ] ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :ascomycota ],
        :tinea_capitis ;
    :has_definition "A tinea capitis that results_in fungal infection located_in scalp, located_in glabrous skin or located_in nail, has_material_basis_in Ascomycota fungi that belong to a group called dermatophytes and results_in_formation_of scutula, yellowish cup-shaped crusts of dense masses of mycelium and epithelial debris, which develop at the surface of a hair follicle with the shaft in the center of the raised lesion. Removal of these crusts reveals an oozing, moist, red base. Later, atrophy of the skin occurs leaving a cicatricial alopecia and scarring." ;
    :has_exact_synonym "favus"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tinea_capitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :scalp ;
                            rdf:rest [ rdf:first :eyelash ;
                                    rdf:rest [ rdf:first :eyebrow ;
                                            rdf:rest [ rdf:first :hair_of_head ;
                                                    rdf:rest :nil ] ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :itching ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :boil ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :patches_of_hair_loss_with_a_black_dot_pattern ],
        :dermatophytosis ;
    :has_definition "A dermatophytosis that results_in contagious fungal infection located_in scalp, located_in hair of head, located_in eyebrow or located_in eyelash, has_material_basis_in Ascomycota fungi that belong to a group called dermatophytes and has_symptom itching of the scalp, has_symptom pus filled lesions on the scalp, and has_symptom patches of hair loss, sometimes with a 'black dot' pattern." ;
    :has_exact_synonym "Scalp ringworm"@en,
        "Trichophyton rubrum tinea capitis"@en,
        "dermatophytosis of scalp or beard"@en,
        "tinea capitis due to Trichophyton rubrum"@en ;
    :has_related_synonym "Dermatophytosis of scalp"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:variegate_porphyria rdfs:subClassOf :acute_porphyria ;
    :has_exact_synonym "Protocoproporphyria"@en,
        "Protoporphyrinogen oxidase deficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lymphocele rdfs:subClassOf :lymphatic_system_disease ;
    :has_exact_synonym "Lymph cyst"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ciliary_body_cancer rdfs:subClassOf :ciliary_body_disease,
        :iris_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :ciliary_body ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "malignant neoplasm of ciliary body"@en,
        "malignant tumor of ciliary body"@en,
        "malignant tumor of the Ciliary body"@en,
        "neoplasm of ciliary body"@en,
        "tumor of the Ciliary body"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ciliary_body_disease rdfs:subClassOf :iris_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
