@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bartter_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :gene ],
        :monogenic_disease,
        :renal_tubular_transport_disease ;
    :has_exact_synonym "Aldosteronism with hyperplasia of the adrenal cortex"@en,
        "Bartter's syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:renal_cell_carcinoma rdfs:subClassOf :renal_carcinoma ;
    :has_definition "A renal carcinoma that has_material_basis_in the lining of the proximal convoluted renal tubule of the kidney." ;
    :has_exact_synonym "RCC"@en,
        "adenocarcinoma of kidney"@en,
        "hypernephroma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:renal_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :epithelial_cell ],
        :carcinoma,
        :kidney_cancer ;
    :has_definition "A kidney cancer that derives_from the lining of the proximal convoluted tubule (the very small tubes in the kidney that filter the blood and remove waste products)." ;
    :has_exact_synonym "carcinoma of kidney"@en,
        "kidney carcinoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_kidney_cell_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :renal_cell_carcinoma ;
    :has_exact_synonym "pediatric renal cell carcinoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_hyperaldosteronism rdfs:subClassOf :adrenal_gland_hyperfunction ;
    :has_definition "An adrenal gland hyperfunction disease that results in the overproduction of aldosterone by the adrenal glands." ;
    :has_exact_synonym "Cushing syndrome"@en,
        "Cushing's syndrome"@en,
        "hyperaldosteronism"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multilocular_clear_cell_renal_cell_carcinoma rdfs:subClassOf :renal_cell_carcinoma ;
    :has_exact_synonym "cystadenocarcinoma of kidney"@en,
        "renal cystadenocarcinoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:collecting_duct_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :collecting_duct_of_renal_tubule ],
        :renal_cell_carcinoma ;
    :has_definition "A renal cell carcinoma that begins in distal collecting ducts of the kidney with a tubulopapillary morphology and intracytoplasmic mucicarminophilic material." ;
    :has_exact_synonym "carcinoma of renal Collecting duct"@en,
        "renal Medullary carcinoma"@en,
        "renal carcinoma, collecting duct type"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:papillary_renal_cell_carcinoma rdfs:subClassOf :renal_cell_carcinoma ;
    :has_definition "A renal cell carcinoma that is characterized by the development of multiple, bilateral papillary renal tumors." ;
    :has_exact_synonym "Chromophil carcinoma of kidney"@en,
        "papillary kidney carcinoma"@en,
        "sporadic papillary renal cell carcinoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:clear_cell_renal_cell_carcinoma rdfs:subClassOf :renal_cell_carcinoma ;
    :has_definition "A renal cell carcinoma that has_material_basis_in cells that appear very pale or clear when examined under microscope." ;
    :has_exact_synonym "Clear cell carcinoma of kidney"@en,
        "clear cell kidney carcinoma"@en,
        "conventional (Clear cell) renal cell carcinoma"@en,
        "conventional renal cell carcinoma"@en,
        "renal clear cell carcinoma"@en ;
    :has_related_synonym "Clear-cell metastatic renal cell carcinoma",
        "Clear-cell metastatic renal cell carcinoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:clear_cell_adenocarcinoma rdfs:subClassOf :adenocarcinoma ;
    :has_definition "An adenocarcinoma that derives_from epithelial cells which have clear cytoplasm." ;
    :has_exact_synonym "Mesonephroid Clear cell carcinoma"@en,
        "Mesonephroma, malignant"@en,
        "Water-clear cell adenocarcinoma"@en,
        "Water-clear cell carcinoma"@en,
        "Wolffian duct neoplasm"@en,
        "malignant Mesonephroma"@en,
        "mesonephroma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:renal_tubular_transport_disease rdfs:subClassOf :kidney_disease ;
    :has_exact_synonym "inborn renal tubular transport disorder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chromophobe_renal_cell_carcinoma rdfs:subClassOf :renal_cell_carcinoma ;
    :has_definition "A renal cell carcinoma that has_material_basis_in chromophobe cell that appear pale when viewed under microscope, but that are larger and display different features than clear cells." ;
    :has_exact_synonym "Chromophobe carcinoma of kidney"@en,
        "chromophobe adenocarcinoma"@en,
        "kidney chromophobe"@en,
        "renal cell carcinoma, chromophobe cell"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sarcomatoid_renal_cell_carcinoma rdfs:subClassOf :renal_cell_carcinoma ;
    :has_exact_synonym "renal cell carcinoma, spindle cell"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:achondroplasia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :severe_short_stature ],
        :osteochondrodysplasia ;
    :has_definition "An osteochondrodysplasia that is characterized by short stature caused by rhizomelic shortening of the limbs, characteristic facies with frontal bossing and midface hypoplasia, exaggerated lumbar lordosis, limitation of elbow extension, genu varum, and trident hand and that has_material_basis_in heterozygous mutation in the fibroblast growth factor receptor-3 gene (FGFR3) on chromosome 4p16.3. Achondroplasia results in dwarfism due to the abnormal ossification of cartilage in the long bone." ;
    :has_exact_match "MESH:D000130" ;
    :has_exact_synonym "Achondroplastic physique"@en,
        "Chondrodystrophia"@en,
        "osteosclerosis congenita"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:allergic_rhinitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :respiratory_tract ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :allergic_reaction ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :airborne_transmission ],
        :respiratory_allergy,
        :rhinitis ;
    :has_definition "A rhinitis that is an allergic inflammation and irritation of the nasal airways involving sneezing, runny nose, nasal congestion, itching and tearing of the eyes caused by exposure to an allergen such as pollen, dust, mold, animal dander and droppings of cockroaches or house dust mites." ;
    :has_exact_match "MESH:D065631" ;
    :has_exact_synonym "Non-seasonal allergic rhinitis"@en,
        "Perenial allergic rhinitis"@en,
        "atopic rhinitis"@en,
        "hay fever"@en,
        "pollenosis"@en,
        "seasonal allergic rhinitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rhinitis rdfs:subClassOf :nasal_cavity_disease ;
    :has_definition "A upper respiratory infectious disease which involves irritation and inflammation of the mucous membrane of the nose due to viruses, bacteria or irritants. The inflammation results in generation of excessive amounts of mucus leading to runny nose, as well as nasal congestion and post-nasal drip." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malignant_biphasic_mesothelioma rdfs:subClassOf :malignant_mesothelioma ;
    :has_exact_synonym "Mesothelioma, biphasic, malignant"@en,
        "mixed Mesothelioma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sarcomatoid_mesothelioma rdfs:subClassOf :malignant_mesothelioma ;
    :has_exact_synonym "malignant fibrous mesothelioma"@en,
        "spindled mesothelioma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malignant_peritoneal_solitary_fibrous_tumor rdfs:subClassOf :peritoneum_cancer ;
    :has_definition "A peritoneum cancer that is characterized by the presence of prominent hemangiopericytoma-like vessels and that arises from the peritoneum." ;
    :has_exact_synonym "Pleural and peritoneal Solitary fibrous tumor"@en,
        "Pleural and peritoneal Solitary fibrous tumour"@en,
        "malignant peritoneal solitary fibrous tumour"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:persian_gulf_syndrome rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome affecting returning military veterans and civilian workers of the Gulf War." ;
    :has_exact_synonym "Gulf war syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:avian_influenza rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :adult_respiratory_distress_syndrome ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pharynx_inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :influenza_a_virus ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :pneumonia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        :influenza ;
    :has_definition "An influenza that results in infection located in respiratory tract of humans, domestic and wild birds, has_material_basis_in Influenza A virus, which is transmitted by contact with infected poultry. Five strains of avian influenza A viruses (H5N1, H7N3, H7N2, H7N7 and H9N2) are known to cause human infections. The infection has_symptom fever, has_symptom cough, has_symptom sore throat, has_symptom muscle aches, has_symptom nausea, has_symptom diarrhea, has_symptom vomiting, has_symptom neurologic changes, has_symptom pneumonia, and has_symptom acute respiratory distress." ;
    :has_exact_synonym "avian flu"@en,
        "bird flu"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myotonic_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :muscular_dystrophy ;
    :has_definition "A muscular dystrophy that is characterized by progressive muscle wasting and weakness." ;
    :has_exact_match "MESH:D009223" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypokalemia rdfs:subClassOf :mineral_metabolism_disease ;
    :has_exact_synonym "hypopotassemia"@en,
        "potassium deficiency disorder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:orofaciodigital_syndrome rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome that is characterized by malformations of the face, oral cavity, and digits." ;
    :has_exact_synonym "oral-facial-digital syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:central_nervous_system_angiosarcoma rdfs:subClassOf :central_nervous_system_sarcoma ;
    :has_definition "A central nervous system sarcoma that is located_in the inner lining of blood vessels." ;
    :has_exact_synonym "hemangiosarcoma of the CNS"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_angiosarcoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :angiosarcoma ;
    :has_definition "An angiosarcoma that affects children." ;
    :has_exact_synonym "pediatric angiosarcoma",
        "paediatric angiosarcoma"@en,
        "paediatric hemangiosarcoma"@en,
        "pediatric hemangiosarcoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aorta_angiosarcoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :aorta ],
        :angiosarcoma,
        :aortic_disease ;
    :has_definition "An angiosarcoma that is located_in the aorta." ;
    :has_exact_synonym "Aortic hemangiosarcoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:breast_angiosarcoma rdfs:subClassOf :breast_sarcoma ;
    :has_definition "An angiosarcoma and sarcoma of breast and vascular neoplasm of breast that is located_in the cells that line the blood vessels within the breast or underarm area." ;
    :has_exact_synonym "hemangiosarcoma of the breast"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gallbladder_angiosarcoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :gallbladder ],
        :angiosarcoma,
        :gallbladder_cancer ;
    :has_definition "An angiosarcoma and gallbladder sarcoma that is located_in the gallbladder." ;
    :has_exact_synonym "hemangiosarcoma of gallbladder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thyroid_angiosarcoma rdfs:subClassOf :thyroid_sarcoma ;
    :has_definition "A thyroid sarcoma and angiosarcoma that results_in a high prevalence of iodine-deficient goiter." ;
    :has_exact_synonym "hemangiosarcoma of the Thyroid"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thyroid_sarcoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :thyroid_gland ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :embryonic_cell_metazoa_ ],
        :sarcoma,
        :thyroid_cancer ;
    :has_definition "A thyroid gland cancer that is located_in the supporting cells of the thyroid." ;
    :has_exact_synonym "sarcoma of the Thyroid gland"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:skin_angiosarcoma rdfs:subClassOf :skin_sarcoma ;
    :has_definition "An angiosarcoma and hemangioma of skin and malignant skin vascular tumor and sarcoma of skin that is located_in the skin and results_in an enlarged bruise (a blue-black nodule) and an unhealed ulceration." ;
    :has_exact_synonym "angiosarcoma of skin"@en,
        "hemangiosarcoma of the skin"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pleomorphic_adenoma rdfs:subClassOf :gastrointestinal_system_benign_neoplasm ;
    :has_definition "A gastrointestinal system benign neoplasm that is a located_in the salivary glands." ;
    :has_exact_synonym "mixed tumor of the Salivary gland"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cervical_endometrial_stromal_sarcoma rdfs:subClassOf :cervix_endometrial_stromal_tumor ;
    :has_definition "A cervix endometrical stromal tumor that has_material_basis_in abnormally proliferating cells derives_from embryonic mesoderm." ;
    :has_exact_synonym "endometrial stromal sarcoma of the cervix"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cervix_endometrial_stromal_tumor rdfs:subClassOf :cervical_cancer ;
    :has_definition "A cervical cancer that derives_from the fibrous connective tissue of the endometrium." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:superior_vena_cava_angiosarcoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :anterior_vena_cava ],
        :angiosarcoma,
        :vein_disease ;
    :has_exact_synonym "angiosarcoma of the Superior Vena Cava"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:prostate_angiosarcoma rdfs:subClassOf :prostate_sarcoma ;
    :has_definition "An angiosarcoma and sarcoma of prostate that is located_in the prostate." ;
    :has_exact_synonym "Prostatic hemangiosarcoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mediastinum_angiosarcoma rdfs:subClassOf :angiosarcoma ;
    :has_definition "An angiosarcoma and sarcoma of the mediastinum that is located_in the mediastinum." ;
    :has_exact_synonym "hemangiosarcoma of mediastinum"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ovarian_angiosarcoma rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :derives_from ;
                            owl:someValuesFrom :embryonic_cell_metazoa_ ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :ovary ] ;
                            rdf:rest :nil ] ] ],
        :angiosarcoma,
        :ovarian_cancer,
        :sarcoma ;
    :has_definition "An ovary sarcoma that is a malignant vascular tumor that derives_from blood vessels." ;
    :has_exact_synonym "hemangiosarcoma of Ovary"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mucoepidermoid_carcinoma rdfs:subClassOf :carcinoma ;
    :has_definition "A carcinoma that is characterized by the presence of cuboidal mucous cells, goblet-like mucous cells, squamoid cells, cystic changes, and a fibrotic stromal formation." ;
    :has_exact_synonym "MEC"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hallermann_streiff_syndrome rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome that affects growth, cranial development, hair growth and dental development." ;
    :has_exact_synonym "Francois dyscephalic syndrome"@en,
        "Hallerman - Streiff syndrome"@en,
        "Hallermann's syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypotrichosis rdfs:subClassOf :hair_disease ;
    :has_definition "A hair disease that is characterized by sparse hair on the scalp resulting from abnormal hair follicle development and has_material_basis_in mutations in proteins involved in hair growth, division or proliferation of cells within hair follicles." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dysgraphia rdfs:subClassOf :writing_disorder ;
    :has_definition "A writing disorder that involves a deficiency in the ability to write where the writing is distorted or incorrect, spelling difficulty, poor handwriting or trouble putting thoughts on paper." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nominal_aphasia rdfs:subClassOf :aphasia ;
    :has_definition "An agnosia that involves a severe problem with recalling words or names." ;
    :has_exact_synonym "Anomic aphasia"@en,
        "anomia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:basophil_adenoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :basophil ],
        :leukocyte_disease,
        :pituitary_adenoma ;
    :has_exact_synonym "Pituitary gland Basophilic adenoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:retrograde_amnesia rdfs:subClassOf :amnestic_disorder ;
    :has_definition "An amnestic disorder that involves a loss of one's pre-existing memories to conscious recollection." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_mesenchymal_chondrosarcoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :mesenchymal_chondrosarcoma ;
    :has_exact_synonym "pediatric mesenchymal chondrosarcoma" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adult_mesenchymal_chondrosarcoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :adult_onset ],
        :mesenchymal_chondrosarcoma ;
    :has_definition "An adult sarcoma of soft tissue and mesenchymal chondrosarcoma that is located_in the cartilage." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:extraskeletal_mesenchymal_chondrosarcoma rdfs:subClassOf :extraskeletal_myxoid_chondrosarcoma ;
    :has_exact_synonym "mesenchymal extraosseous chondrosarcoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:extraskeletal_myxoid_chondrosarcoma rdfs:subClassOf :chondrosarcoma ;
    :has_definition "A chondrosarcoma that is located_in exclusively soft tissue and that is characterized by the presence of chondroblast-like cells in a myxoid stroma and a multinodular growth pattern." ;
    :has_exact_synonym "Myxoid extraosseous chondrosarcoma",
        "extraosseous chondrosarcoma" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anus_benign_neoplasm rdfs:subClassOf :anus_disease,
        :intestinal_benign_neoplasm ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :benign_neoplasm ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :anus ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "anal neoplasm"@en,
        "anal tumors"@en,
        "neoplasm of anus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:large_cell_carcinoma rdfs:subClassOf :carcinoma ;
    :has_definition "A carcinoma that is composed of large, monotonous rounded or overtly polygonal-shaped cells with abundant cytoplasm." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thymus_large_cell_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :thymus ],
        :thymic_carcinoma ;
    :has_exact_synonym "large cell carcinoma of the Thymus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:type_c_thymoma rdfs:subClassOf :thymoma ;
    :has_exact_synonym "Thymoma, type C"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ovarian_large_cell_neuroendocrine_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :ovary ],
